export const Card = ({ data }) => {
  return (
    <div>
      {data.map(({ id, price, quantity, title, author, url }) => (
        <div key={id}>
          <img src={url} alt={title} width="480" />
          <h2>{title}</h2>
          <p>
            Author: <a href={author.url}>{author.tag}</a>
          </p>
          <p>Price: {price}</p>
          <p>Quantity: {quantity}</p>
          <button>Add</button>
        </div>
      ))}
    </div>
  );
};
